import React from "react";
import Header from "./Header";
import Footer from "./Footer";

const Body = () => (
  <div
    style={{
      backgroundColor: "#133",
      width: "100%",
      height: "100%",
      margin: "10%",
    }}
  >
    SAVE IN BITS EVERYTIME YOU SPEND. EARN DOLLARS DAILY.
  </div>
);

function Home() {
  return (
    <div>
      <Header />
      <Body />
      <Footer />
    </div>
  );
}

export default Home;
